('51', 'A5', 'DevOps é um conjunto de práticas e mudanças culturais - apoiadas pelas ferramentas corretas - que cria uma esteira de entrega de software automatizada, permitindo organizações ganhar, servir e reter clientes.', '4', '0', 'pt-BR', '0'),
('51', 'A1', 'O DevOps é a combinação de filosofias culturais, práticas e ferramentas que aumentam a capacidade de uma empresa de distribuir aplicativos e serviços em alta velocidade: otimizando e aperfeiçoando produtos em um ritmo mais rápido do que o das empresas que usam processos tradicionais de desenvolvimento de software e gerenciamento de infraestrutura. Essa velocidade permite que as empresas atendam melhor aos seus clientes e compitam de modo mais eficaz no mercado.', '1', '0', 'pt-BR', '0'),
('51', 'A2', 'DevOps é um termo criado para descrever um conjunto de práticas para integração entre as equipes de desenvolvimento de softwares, operações (infraestrutura ou sysadmin) e de apoio envolvidas (como controle de qualidade) e a adoção de processos automatizados para produção rápida e segura de aplicações e serviços.', '2', '0', 'pt-BR', '0'),
('51', 'A4', 'DevOps representa uma mudança na cultura de TI, com foco na entrega rápida de serviços através da adoção do desenvolvimento ágil, práticas enxutas no contexto de uma abordagem orientada a sistemas. DevOps enfatiza pessoas (e cultura), e busca melhorar a colaboração entre times de operação e desenvolvimento. Implementações de DevOps  utilizam tecnologia - especialmente ferramentas de automação que suportam uma infraestrutura incremental programável e dinâmica da perspectiva do ciclo de vida.', '3', '0', 'pt-BR', '0'),
