('21', '881488', 'Analise do Ceu', '0', '<h1 style=\"text-align:center;\"><span style=\"font-size:14px;\"><span style=\"font-family:Verdana, Geneva, sans-serif;\">Nesta etapa, gostaríamos que você nos contasse o que acha sobre o propósito do time, para que ele serve e quais princípios e premissas devem nortear nossas decisões, como mediremos o sucesso do time? O nosso próprio sucesso e nosso crescimento? Por fim, avaliar os riscos do time também é importante para seguirmos fazendo a coisa certa! </span></span></h1>\r\n', 'pt-BR', '', ''),
('22', '881488', 'Suas Habilidades Técnicas', '1', '<h1 style=\"text-align:center;\"><span style=\"font-size:14px;\"><span style=\"font-family:Verdana, Geneva, sans-serif;\"><strong>Entender e balancear o nosso time é parte importante do nosso crescimento </strong></span><br /><span style=\"font-family:Verdana, Geneva, sans-serif;\">Além de alinharmos internamente como devemos seguir como time, é importante conhecer suas habilidades técnicas, dessa forma podemos direcionar seu crescimento dentro das diferentes áreas do conhecimento em um time de Design. </span></span></h1>\r\n\r\n<h1> </h1>\r\n', 'pt-BR', '', ''),
('23', '881488', 'Visual', '2', '<h1 style=\"text-align:center;\"><span style=\"font-size:14px;\"><span style=\"font-family:Verdana, Geneva, sans-serif;\">Olhando para aspectos <strong>estéticos e visuais</strong>, se auto avalie em cada um dos quesitos abaixo referente ao conhecimento que você acredita ter.  <br />\r\nResponda este questionário sendo o mais sincero possível, é extremamente importante termos uma visão real do nosso atual cenário técnico. </span></span></h1>\r\n', 'pt-BR', '', ''),
('24', '881488', 'UXUI', '3', '<h1 style=\"text-align:center;\"><span style=\"font-size:14px;\"><span style=\"font-family:Verdana, Geneva, sans-serif;\">Olhando para aspectos de <strong>Experiência e prototipação</strong>, se auto avalie em cada um dos quesitos abaixo referente ao conhecimento que você acredita ter.<br />\r\nResponda este questionário sendo o mais sincero possível, é extremamente importante termos uma visão real do nosso atual cenário técnico. </span></span></h1>\r\n', 'pt-BR', '', ''),
('25', '881488', 'User Research', '4', '<h1 style=\"text-align:center;\"><span style=\"font-size:14px;\"><span style=\"font-family:Verdana, Geneva, sans-serif;\">Olhando para aspectos de <strong>pesquisas com usuários</strong> se auto avalie em cada um dos quesitos abaixo referente ao conhecimento que você acredita ter.<br />\r\nResponda este questionário sendo o mais sincero possível, é extremamente importante termos uma visão real do nosso atual cenário técnico. </span></span></h1>\r\n', 'pt-BR', '', ''),
('26', '567148', 'Analise do Ceu', '1', '<h1 style=\"text-align:center;\"><span style=\"font-size:14px;\"><span style=\"font-family:Verdana, Geneva, sans-serif;\">Bem vindo a pesquisa Técnica do CEU.</span></span></h1>\r\n\r\n<p style=\"text-align:center;\"><span style=\"font-size:14px;\"><span style=\"font-family:Verdana, Geneva, sans-serif;\">Favor se identificar! </span></span></p>\r\n', 'pt-BR', '', ''),
