INSERT INTO `lime_survey_113262` (`id`,`submitdate`,`lastpage`,`startlanguage`,`seed`,`startdate`,`datestamp`,`ipaddr`,`113262X13X135`,`113262X13X136`,`113262X13X137`,`113262X13X138`,`113262X13X139`) VALUES
('1', NULL, NULL, 'pt-BR', '22476922', '2018-11-28 09:50:59', '2018-11-28 09:50:59', '172.16.5.84', NULL, NULL, NULL, NULL, NULL),
('2', '2018-11-28 10:38:57', '1', 'pt-BR', '1649180059', '2018-11-28 10:30:12', '2018-11-28 10:38:57', '172.16.5.84', 'A1', 'A2', 'A2', 'O treinamento foi feito em 4 horas o que deveria ter sido feito em 08 horas. As explicações do inicio foram muito rápidas e ninguém estava entendendo nada. só foi na metade do treinamento quando conseguimos pegar um pouco do que devíamos fazer, porém ficaram lacunas enormes. acredito que uns dos requisitos deveria ser ter conhecimento em Scrum. O instrutor supôs que tudo mundo trabalhava com metodologia ágil, o que em realidade não é assim. \r\n\r\nNão fiquei confortável com esse treinamento. ', ''),
('3', '2018-11-28 10:34:07', '1', 'pt-BR', '1590942935', '2018-11-28 10:31:59', '2018-11-28 10:34:07', '172.16.5.83', 'A3', 'A3', 'A3', '', 'Foi uma pena que tivemos apenas 4 horas deste treinamento, pois se tivéssemos 8 horas seria melhor para assimilarmos melhor as informações passadas, não teve como foi um pouco corrido o treinamento, o mesmo devia ter sido agendado p outro dia para poder ter as 8 horas.'),
('4', '2018-11-28 10:51:18', '1', 'pt-BR', '11868482', '2018-11-28 10:32:04', '2018-11-28 10:51:18', '172.16.5.83', 'A3', 'A3', 'A3', '', ''),
('5', '2018-11-28 10:36:36', '1', 'pt-BR', '792944810', '2018-11-28 10:33:18', '2018-11-28 10:36:36', '172.16.5.83', 'A2', 'A2', 'A3', '', 'O curso que era para um dia inteiro, ficou bem corrido em 4 horas.\nAcredito que o conhecimento do curso com o tempo integral seria melhor aproveitado. '),
('6', NULL, NULL, 'pt-BR', '1105252074', '2018-11-28 10:35:09', '2018-11-28 10:35:09', '10.16.30.34', NULL, NULL, NULL, NULL, NULL),
('7', '2018-11-28 10:43:36', '1', 'pt-BR', '1593239114', '2018-11-28 10:42:10', '2018-11-28 10:43:36', '172.16.5.83', 'A2', 'A2', 'A3', '', 'Este treinamento deveria ter como pré-requisito que os participantes já tenham feito previamente cursos de Scrum Master e/ou Product Owner.'),
('8', '2018-11-28 11:52:14', '1', 'pt-BR', '1823606277', '2018-11-28 11:51:02', '2018-11-28 11:52:14', '172.16.5.84', 'A3', 'A2', 'A3', '', ''),
('9', '2018-11-28 12:14:27', '1', 'pt-BR', '1457264378', '2018-11-28 12:11:23', '2018-11-28 12:14:27', '172.16.5.84', 'A2', 'A3', 'A2', '', 'Curso foi bom, porém seria o dia inteiro e por problemas acabou sendo realizado em meio período, acredito que alguns assuntos ficaram para trás e ficou um pouco corrido para realizarmos as atividades, porém de modo geral o instrutor é bom, e o curso foi bom também.'),
('10', '2018-11-28 12:22:47', '1', 'pt-BR', '1137982114', '2018-11-28 12:21:13', '2018-11-28 12:22:47', '10.16.30.195', 'A3', 'A3', 'A3', '', 'Conceito teórico alinhado à prática.\nMuito boa as dinâmicas que foram aplicadas, isso nos leva a refletir como estamos e como devemos nos atuar nos projetos que estão utilizando o conceito ágil. \n\n'),
('11', '2018-11-28 12:29:48', '1', 'pt-BR', '474091481', '2018-11-28 12:29:17', '2018-11-28 12:29:48', '172.16.5.83', 'A2', 'A2', 'A3', '', ''),
('12', '2018-11-28 12:41:38', '1', 'pt-BR', '221244433', '2018-11-28 12:29:30', '2018-11-28 12:41:38', '172.16.5.84', 'A3', 'A3', 'A3', '', ''),
('13', '2018-11-28 12:55:13', '1', 'pt-BR', '900744471', '2018-11-28 12:54:17', '2018-11-28 12:55:13', '10.16.30.2', 'A3', 'A3', 'A3', '', ''),
('14', '2018-11-28 12:55:47', '1', 'pt-BR', '595704611', '2018-11-28 12:54:40', '2018-11-28 12:55:47', '172.16.5.83', 'A3', 'A3', 'A3', '', 'O workshop foi ótimo, uma pena não ter sido no tempo programado pois acabou ficando corrido e não vimos tudo.'),
('15', '2018-11-28 13:29:41', '1', 'pt-BR', '1313459437', '2018-11-28 13:29:05', '2018-11-28 13:29:41', '172.16.5.84', 'A1', 'A2', 'A2', 'meio período não foi suficiente para o treinamento.', ''),
('16', '2018-11-28 13:32:33', '1', 'pt-BR', '124098835', '2018-11-28 13:29:56', '2018-11-28 13:32:33', '172.16.5.83', 'A2', 'A2', 'A3', '', 'Em linha gerais o treinamento foi bom, mas senti que conteúdo aplicado foi parcialmente comprometido decorrente do tempo. Sou super a favor desses treinamento internos e com profissionais Scopus, vejo que esse modelo pode ser ampliado e aplicado com mais frequência. '),
('17', '2018-11-28 14:23:18', '1', 'pt-BR', '1938198248', '2018-11-28 14:22:58', '2018-11-28 14:23:18', '172.16.5.83', 'A2', 'A2', 'A2', '', ''),
('18', '2018-11-29 09:51:28', '1', 'pt-BR', '1645624150', '2018-11-29 09:51:02', '2018-11-29 09:51:28', '172.16.5.84', 'A1', 'A2', 'A2', '', ''),
('19', '2018-11-29 10:12:19', '1', 'pt-BR', '132861008', '2018-11-29 10:12:01', '2018-11-29 10:12:19', '172.16.5.83', 'A2', 'A2', 'A2', '', ''),
('20', '2018-11-29 13:55:58', '1', 'pt-BR', '767716345', '2018-11-29 13:44:11', '2018-11-29 13:55:58', '172.16.5.84', 'A2', 'A2', 'A2', '', 'Minha sugestão era que no invite tivesse algo informando que era necessário ter um conhecimento básico em Scrum, trabalhar com projetos e etc. No meu grupo as 4 pessoas que estavam comigo não conhecia Scrum e não atuam em projetos. Também achei que devido ao imprevisto do instrutor (que pode ocorrer com qualquer um) ter perdido o voo, o curso poderia ter sido adiado e não passado de 8 horas para 4 horas, parece que era muito conteúdo para pouco tempo, não dava tempo de explicar as tarefas. Essa foi a minha sensação. Outro detalhe é que deu 17 hrs e o instrutor continuava o curso, sendo que muitos dependem de fretado para ir embora, eu mesma não sai na foto do encerramento.'),
('21', '2018-11-29 14:13:11', '1', 'pt-BR', '2045695239', '2018-11-29 14:10:52', '2018-11-29 14:13:11', '172.16.5.84', 'A3', 'A3', 'A3', '', 'Com o treinamento, embora corrido pelo prazo em que foi realizado, ficou perceptível a importância destes treinamento para caminharmos rumo as desafios de desenvolvimento de sistemas utilizando as novas tecnologias.');
