('29', '2018-09-17 13:22:41', '7', 'pt-BR', '708553104', '2018-09-17 13:12:48', '2018-09-17 13:22:41', '172.16.68.112', 'http://survey.scopus.com.br/index.php/admin/tokens/sa/browse/surveyid/792981', 'A1', 'Y', 'A2', 'Y', 'Y', 'Y', '', '', 'Y', '', '', '', '', 'Y', '', '', 'Y', 'Y', '', '', '', 'Y', '', 'Y', '', 'Y', '', 'Y', '', 'Y', '', 'Y', '', '', '', '', '', 'Y', '', 'Y', '', '', '', 'Y', '', '', '', 'Termos acesso mais rápido aos recursos de desenvolvimento como máquina com SSD, memória e capacidade de processamento.\nEu mesmo, estava com uma máquina com apenas 8Gb de memória. A pouco tempo conseguimos fazer um upgrade para 16Gb.\n\nResolvida essa questão de recursos... valorizar a documentação dos projetos. Como devops fala muito em integração entre as áreas, a documentação e comunicação é muito importante.'),
('30', NULL, '-1', 'pt-BR', '166775014', '2018-09-17 13:27:56', '2018-09-17 13:31:30', '172.16.5.84', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
('31', '2018-09-17 13:37:51', '7', 'pt-BR', '1102470499', '2018-09-17 13:29:09', '2018-09-17 13:37:51', '172.16.5.84', NULL, 'A2', 'Y', 'A2', 'Y', 'Y', '', '', '', '', '', 'Y', '', '', '', 'Y', 'Y', '', '', 'Y', '', '', 'Y', '', 'Y', '', 'Y', '', 'Y', '', 'Y', '', 'Y', '', '', '', '', '', '', '', 'Y', '', 'Y', '', 'Y', '', '', '', 'Apoio da direção da empresa. Como também o apoio da Infraestrutura (no caso DevOps) estarem sintonizados e cooperando no desenvolvimento de software. Não colocando barreiras que possam dificultar o desenvolvedor.'),
('32', '2018-09-17 15:11:03', '7', 'pt-BR', '1903336729', '2018-09-17 15:00:54', '2018-09-17 15:11:03', '172.16.5.84', NULL, 'A1', 'Y', 'A1', 'Y', 'Y', 'Y', '', '', '', '', 'Y', '', '', '', 'Y', '', 'Y', '', 'Y', '', 'Processos do cliente incompatíveis', '', '', 'Y', '', '', '', 'Y', '', '', '', 'Y', '', '', '', 'Y', '', 'Y', '', 'Y', '', '', '', 'Y', '', '', '', 'Creio que o ideal seria um processo comum entre Scopus e nossos clientes de forma que possamos de fato aplicar o desenvolvimento e entrega de software de qualidade de ponta a ponta '),
