('41', '2018-09-17 15:14:51', '7', 'pt-BR', '372085531', '2018-09-17 15:09:19', '2018-09-17 15:14:51', '172.16.5.84', NULL, 'A1', 'Y', 'A4', 'Y', 'Y', '', '', '', '', '', '', 'Y', 'Y', '', 'Y', '', 'Y', '', 'Y', '', '', 'Y', 'Maven', 'Y', 'Github, BitBucket', 'Y', 'SonarQube, Checkstyle, PMD', 'Y', 'TFS, Jenkins,', 'Y', 'Junit, Mockito, RestAssured, Selenium, Jasmine', 'Y', 'tfs', '', '', '', '', 'Y', 'Jmeter', 'Y', 'Selenium, Cucumber', 'Y', 'Ansible', 'Y', 'TFS, Starteam', '', '', 'Extremamente necessário haver automatizacao das tarefas para que haja eficiente e qualidade na entrega dos projetos, porém em todas as equipes de trabalhei dentro da Scopus, fora muitas, os funcionários não tem maturidade para entender a necessidade de entregar um código de qualidade, não estudam e não se qualificam em softwares de automatização, colocar estas ferramentas num sistema automatizado como Jenkins vai ajudar, mas cada um tem que saber o que cada plugin dentro do Jenkins faz para entender onde tem que melhorar na qualidade da entrega.'),
('42', '2018-09-17 15:19:56', '7', 'pt-BR', '1888428477', '2018-09-17 15:09:38', '2018-09-17 15:19:56', '172.16.5.83', NULL, 'A2', 'Y', 'A1', '', '', '', '', '', 'Y', '', 'Y', 'Y', 'Y', '', '', 'Y', '', 'Y', '', '', 'Falta de apoio da diretoria para realizar. Exemplo: se o banco diz não, a scopus aparentemente demonstra não contra argumentar, no final, o banco é quem dita o caminho, a Scopus não é conciderada como uma empresa do grupo.', '', '', 'Y', 'TFS para controle de atividades', '', '', '', '', '', '', 'Y', 'TFS é a única ferramenta profissional que tive acesso.', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Banco e Scopus falarem a mesma língua.'),
('43', NULL, '2', 'pt-BR', '1357178390', '2018-09-17 15:09:49', '2018-09-17 15:09:58', '172.16.5.83', NULL, 'A1', 'Y', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
('45', '2018-09-17 15:22:36', '7', 'pt-BR', '1449534071', '2018-09-17 15:11:26', '2018-09-17 15:22:36', '172.16.5.84', NULL, 'A1', 'Y', 'A5', '', 'Y', '', '', '', '', '', 'Y', 'Y', '', '', 'Y', 'Y', '', 'Y', 'Y', 'Y', '', 'Y', '', 'Y', '', '', '', 'Y', '', 'Y', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', 'Apoio da Arquitetura nas iniciativas dos times. Governança tem tido efeito cerceador e passivo e não incentivador e apoiador.\n'),
('46', '2018-09-17 15:42:14', '7', 'pt-BR', '4164720', '2018-09-17 15:12:47', '2018-09-17 15:42:14', '172.16.5.84', NULL, 'A2', 'Y', 'A2', '', 'Y', 'Y', '', '', '', 'Y', '', 'Y', '', '', '', 'Y', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', 'Ofertar com empenho DevOps, criar janelas nas agendas das equipes, formar equipe habilitada, incentivar ampliação e repasse (conhecimento e equipes no formato), incentivar a expansão e utilização do processo! Desenvolver não apenas um aplicação, mas criar um modelo receptivo a modelar um processo não padronizado, mas flexível e aperfeiçoável, que gere inovação com valor significativo! '),
('47', '2018-09-17 15:20:37', '7', 'pt-BR', '1063017355', '2018-09-17 15:14:25', '2018-09-17 15:20:37', '172.16.5.83', NULL, 'A1', 'Y', 'A1', '', 'Y', 'Y', '', '', '', '', 'Y', 'Y', 'Y', '', '', '', 'Y', '', 'Y', 'Y', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
('48', '2018-09-17 15:19:46', '7', 'pt-BR', '528853991', '2018-09-17 15:14:33', '2018-09-17 15:19:46', '172.16.5.83', NULL, 'A1', 'Y', 'A4', '', '', '', '', '', 'Y', '', 'Y', 'Y', '', '', '', '', '', '', '', '', 'falta de equipamento e sofware adequados.', '', '', 'Y', '', '', '', 'Y', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', 'Disponibilizar maquinas  e softwares de ponta\r\nFazer uma planejamento melhor para adoção de novos métodos de trabalho.\r\nReavaliar e remunerar os recursos, há muito recurso como junior executando serviço de Pleno e Senior, e alguns Seniors e plenos parado.'),
