('62', '2018-09-17 15:42:53', '7', 'pt-BR', '2027509116', '2018-09-17 15:31:54', '2018-09-17 15:42:53', '172.16.68.113', NULL, 'A1', 'Y', 'A1', '', '', '', '', '', '', '', 'Y', 'Y', '', 'Y', 'Y', 'Y', '', '', 'Y', '', '', 'Y', '', 'Y', '', '', '', 'Y', '', 'Y', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', 'Começar, trabalhar no processo, adotando, mesmo que em pequenas partes, metodologias de automação que otimizam as rotinas de atividades.'),
('63', '2018-09-17 15:38:18', '7', 'pt-BR', '1276450650', '2018-09-17 15:32:20', '2018-09-17 15:38:18', '172.16.211.50', NULL, 'A1', 'Y', 'A1', 'Y', '', 'Y', '', '', '', '', 'Y', 'Y', 'Y', '', '', '', '', '', '', '', 'Cultura corporativa', 'Y', 'Gradle, npm/yarn, MSBuild', 'Y', 'Github, Gitlab, SVN, CVS', 'Y', 'SonarQube, Vega, MobSF', 'Y', 'Jenkins, fastlane', 'Y', 'NUnit', 'Y', 'Jira, Redmine, Gitlab, Github', '', '', 'Y', 'Nagios', '', '', 'Y', 'Selenium, Appium', '', '', '', '', '', '', ''),
('64', '2018-09-17 15:39:45', '7', 'pt-BR', '1429785483', '2018-09-17 15:33:48', '2018-09-17 15:39:45', '172.16.4.29', NULL, 'A3', 'Y', 'A2', '', 'Y', 'Y', '', 'Y', '', '', '', 'Y', '', 'Y', '', '', '', 'Y', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', 'Y', '', 'Y', '', '', '', '', '', 'Y', '', '', '', ''),
('65', NULL, '3', 'pt-BR', '388038984', '2018-09-17 15:34:12', '2018-09-17 15:35:14', '172.16.5.83', NULL, 'A1', 'Y', 'A2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
('66', '2018-09-17 15:57:36', '7', 'pt-BR', '144957861', '2018-09-17 15:34:45', '2018-09-17 15:57:36', '172.16.5.83', NULL, 'A1', 'Y', 'A1', 'Y', '', '', 'Y', 'Y', '', '', '', 'Y', '', '', 'Y', '', '', 'Y', '', '', 'Principal barreira: um gestor não técnico e que não entende de desenvolvimento define o que deve ser utilizado para o desenvolvimento.', 'Y', 'Maven', 'Y', 'Git', '', '', '', '', 'Y', 'JUnit', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Ferramenta para deploy de micro serviço', 'Docker', '1. Reestruturação de todos os componentes/fontes do banco.\n2. Organização em um repositório único (Artifactory)\n3. Versionamento em Manifest ao invés de utilizar o nome do componente\n4. Fazer um projeto para desacoplar todo o bcpf_core do mobile pf \n5. Criar uma equipe de arquitetura que organize todas as aplicações em micro serviços\n6. Definição de novas tecnologias a serem usadas nos projetos (e.g. Spring, Ionicc, etc)\n7. Utilizar as tecnologias mais recentes ao invés de usar apenas coisas desatualizadas como Struts/Java 1.5. Deveríamos utilizar tecnologias mais recentes como Spring 5 e Java 1.9, dentre tantas outras.\n8. Ter uma equipe responsável por fazer validação de código para garantir que desenvolvedores Jr e Pl não entreguem código sem qualidade ou que viole os princípios da arquitetura de um projeto de desenvolvimento de software.\n9. Qualificar as pessoas para utilizarem Design Patterns\n10. Colocar, na arquitetura, pessoas devidamente qualificadas em Ciência da Computação, Engenharia da Computação e, de preferência, que possuam mestrado/doutorado e que tenham condições de acompanhar a evolução tecnológica para que os serviços do banco estejam sempre utilizando as tecnologias mais adequadas para construção dos serviços do banco.'),
('67', '2018-09-17 15:41:36', '7', 'pt-BR', '1307217819', '2018-09-17 15:35:32', '2018-09-17 15:41:36', '172.16.210.34', NULL, 'A1', 'Y', 'A1', '', '', 'Y', '', '', 'Y', '', '', 'Y', 'Y', '', '', 'Y', '', '', '', 'Y', '', '', '', 'Y', 'GitHub, GitLab, TFS', '', '', '', '', '', '', 'Y', 'TFS, Redmine, Jira', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Além do desenvolvimento está a questão do valor gerado pelo mesmo. A avaliação do valor gerado ao se desenvolver uma aplicação (métodos de UX) auxiliam no pré desenvolvimento fazendo com que as equipes possam desenvolver apenas aquilo que gera valor - ao negócio e ao Cliente - otimizando as esteiras de desenvolvimento e permitindo uma cadência maior e melhor de projetos (Mitigar o cancelamento de um projeto durante o processo de desenvolvimento) '),
('68', '2018-09-17 15:42:37', '7', 'pt-BR', '1382687306', '2018-09-17 15:36:41', '2018-09-17 15:42:37', '172.16.14.144', NULL, 'A1', 'Y', 'A4', '', 'Y', '', '', '', 'Y', '', 'Y', 'Y', '', '', '', 'Y', '', '', 'Y', 'Y', '', 'Y', '', 'Y', '', '', '', 'Y', '', 'Y', '', 'Y', '', 'Y', '', 'Y', '', 'Y', '', '', '', 'Y', '', 'Y', '', '', '', 'Precisamos montar um grupo de DevOps para apresentar para todos os times o que é DevOps, para que experimentem o conceito e as ferramentas e depois passar a elaborar um plano para adoção na empresa inteira. Um dos grandes problemas hoje é que muitos não tem condições de opinar por não terem experimentado a tecnologia e isso seria resolvido com esse grupo. A adoção tem que ser bem gradual mas quando tivermos um sistema 100% com DevOps implementado, com todas as frentes (qualidae de fonte, testes automatizados, gestão de configuração) aí sim teremos subsídio para trazer outros departamentos para essa iniciativa.'),
