('76', '2018-09-17 15:59:07', '7', 'pt-BR', '1526203375', '2018-09-17 15:43:39', '2018-09-17 15:59:07', '172.16.5.83', NULL, 'A1', 'Y', 'A2', 'Y', 'Y', '', '', '', '', '', 'Y', '', 'Y', '', 'Y', '', '', '', 'Y', 'Y', '', 'Y', 'Maven, Gradle', 'Y', 'TFS, GIT', '', '', 'Y', 'TFS', 'Y', 'JUnit', 'Y', 'TFS', '', '', 'Y', 'BMC Patrol', '', '', '', '', '', '', 'Y', 'TFS, Starteam, HP', '', '', 'Deve-se melhorar o gerenciamento de projetos, aprender a dizer não quando necessário para o cliente, fazer uma pré-venda eficiente, começar a alocar tempo no projeto para o uso de TDD no desenvolvimento e começar a usar tecnologias mais modernas e alinhadas com a realidade do mercado.'),
('77', NULL, '2', 'pt-BR', '514961117', '2018-09-17 15:44:12', '2018-09-17 15:44:48', '172.16.5.84', NULL, 'A1', 'Y', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
('78', '2018-09-17 15:50:16', '7', 'pt-BR', '1703510161', '2018-09-17 15:45:08', '2018-09-17 15:50:16', '172.16.5.84', NULL, 'A1', 'N', 'A4', '', 'Y', '', '', '', 'Y', 'Y', 'Y', '', '', '', '', 'Y', '', '', 'Y', '', '', 'Y', 'Gradle e Maven', 'Y', 'TFS, Github, Gitlab, Bitbucket', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', 'TFS, Starteam', '', '', 'Uma sugestão seria acrescentar minicursos ou palestras organizadas e realizadas por funcionários da própria Scopus, ou com entidades externas, para capacitar e melhorar sempre o time.'),
('80', '2018-09-17 16:10:08', '7', 'pt-BR', '915243564', '2018-09-17 15:46:52', '2018-09-17 16:10:08', '172.16.57.65', NULL, 'A1', 'Y', 'A4', '', 'Y', 'Y', '', '', 'Y', '', '', 'Y', 'Y', '', '', '', '', '', '', '', 'Falta de comprometimento da alta direção Bradesco, pois em muito casos não há planejamento para criar um projeto.', '', '', 'Y', 'TFS, Github', '', '', '', '', '', '', 'Y', 'Redmine, ALM (HP)', '', '', '', '', 'Y', 'JMeter', '', '', '', '', 'Y', 'HP', '', '', 'Ao meu ver o maior desafio para melhorar as atividades de desenvolvimento de software é atacar no planejamento de um projeto, pois noto que geralmente o usuário não tem a definição do software ou em outras vezes não, há tempo para planejar e o cliente quer que seja feito o desenvolvimento do dia para a noite. Ao meu ver o planejamento é fundamental para o sucesso de um projeto, mesmo nos casos de inovação, que as vezes para sair na frente do concorrente se comete erros no planejamento. O time de Dev e de Negócio devem estar próximos, é claro com a blindagem de um Scrum Master e para finalizar o projeto necessita ser Ágil.'),
('81', NULL, '6', 'pt-BR', '637067386', '2018-09-17 15:47:13', '2018-09-17 16:02:06', '172.16.5.84', NULL, 'A1', 'Y', 'A5', '', 'Y', '', '', '', '', 'Y', 'Y', 'Y', 'Y', '', '', '', '', '', '', '', 'Permissão para Inovar', 'Y', 'Gradle, Maven', 'Y', 'TFS', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', 'Selenium', '', '', '', '', '', '', NULL),
('82', '2018-09-17 15:55:38', '7', 'pt-BR', '1709328438', '2018-09-17 15:47:32', '2018-09-17 15:55:38', '172.16.5.83', NULL, 'A1', 'Y', 'A1', '', 'Y', 'Y', '', 'Y', 'Y', '', '', 'Y', '', '', '', '', 'Y', 'Y', 'Y', '', '', 'Y', 'graddle e maven', 'Y', 'tfs, github', 'Y', 'checkstyle e pmd', '', '', 'Y', 'junit', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', 'tfs e starteam', '', '', 'Acredito que para acontecer essa melhoria é necessário uma melhor gestão nos projetos (estamos extremamente sobrecarregados ocupando horários alem da carga de trabalho, finais de semanas e feriados) e acompanhamento por profissionais de alta senioridade, assim vamos conseguir melhorar e equalizar os profissionais. Um item importante é a qualidade de vida dos funcionários, na minha visão gasta-se muito tempo executando atividades fora da carga de trabalho devido a falta de tempo/organização dos projetos. Uma vida com mais tempo de lazer também auxilia o desenvolvimento e a satisfação profissional.'),
