('114', '2018-09-17 16:39:58', '7', 'pt-BR', '1891811384', '2018-09-17 16:08:09', '2018-09-17 16:39:58', '172.16.5.84', NULL, 'A1', 'Y', 'A1', 'Y', 'Y', '', '', '', 'Y', 'Y', '', '', '', '', 'Y', '', '', 'Y', '', '', 'Falta de Recirso aliado com conhecimento, a scopus tinha que contratar um empresa especilizada nisso e ir em cada area implantando, mas nao adianta muito se o Banco nosso cliente nao tem essa cultura.', 'Y', 'maven', 'Y', 'tfs GIT', '', '', 'Y', 'tfs', '', '', 'Y', 'TFS nao gerencia incident', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'O problema é que cada area do Bradesco, trabalha de uma maneira, como se fossem empresas diferentes, sendo assim a respectiva area da Scopus vai trabalhar diferente, e é tudo muito engessado pelo Bradesco, a scopus não tem como tomar a decisão de utlilizar um Devops onde tudo esta automatizado na scopus e continuar tendo que entregar codigo no Starteam, continuar recebendo EF em PPT, a precisar de uma massa de dados e demorar dias para conseguir, a precisar da equipe de mainframe e demorar dias para receber a resposta e ainda errada.\nPrimeiramente as areas do Bradesco teriam que estar alinhadas em ferramentas de Devops, processos, metodologias, e scopus participar com cada area na definição e implementação disso tudo.\nA scopus e o bradesco tinham que estar na mesma rede, falando pelo mesmo Skype, a scopus tinha que ter acesso aos ambientes bradesco, inclusive Produção com a determinada segurança claro, nem o proprio DS tem acesso aos ambientes de TU e TH do bradesco, é tudo muito amarrado tudo muito burocrático, Um devops nao funciona se o Bradeco e a Scopus não estiverem na mesma pagina, no mesmo alinhamento em acessos, ambientes e principalmente processos, e sim, é possível fazermos isso, em muitos outros lugares e instituições maiores isso funciona.\n'),
