('217', '2018-09-18 14:40:14', '7', 'pt-BR', '467506345', '2018-09-18 14:27:02', '2018-09-18 14:40:14', '172.16.14.15', NULL, 'A1', 'Y', 'A4', '', '', 'Y', 'Y', '', '', '', '', 'Y', '', '', 'Y', '', '', '', '', '', 'Excesso de controles e colocação de atividades de controle dentro das horas úteis do projeto o que diminuem as horas para melhorar e otimizar as entregas, melhorando todo o contexto da entrega.', 'Y', 'Maven, Node, Nuget', 'Y', 'TFS, Github, SVN', '', '', 'Y', 'TFS, Jenkins', 'Y', 'SOAPUI, Junit', 'Y', 'Redmine, OTRS, TFS e JIRA', '', '', 'Y', 'Zabbix e Nagios', 'Y', 'Jmeter e SoapUI', '', '', '', '', '', '', '', '', 'Diminuir a quantidade de controles, incentivar o cross de conhecimento, diminuindo a quantidade de feudos existentes na empresa, onde uma área é dona daquilo que faz e caso seja proposto um cross com outras áreas, ao fazer isso para alguns é tratado como um crime.\r\n\r\nFalta uma visão que pode ser de uma área nova ou dos gestores, que permitam que se saiba o que as equipes fazem e se permita fazer cross das coisa e aumentar o compartilhamento do expertise de cada um, sem ser algo incipiente ou apenas feito a força, pois hoje é notório que se fazem três ou quatro iniciativas para entregar a mesma coisa por equipes diferentes em projetos diferentes e poderíamos fazer isso mais rápido reaproveitando o que já foi feito ou o expertise de quem realizou, isso não é feito porque não as equipes/gestores não sabem o que as outras fazem.'),
