('245', '2018-09-21 12:16:10', '7', 'pt-BR', '2037851498', '2018-09-21 12:08:04', '2018-09-21 12:16:10', '172.16.5.83', NULL, 'A1', 'Y', 'A4', 'Y', 'Y', 'Y', '', '', '', '', 'Y', '', 'Y', '', '', '', '', '', '', 'Y', '', '', '', 'Y', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', 'Adoção de métodos e processos de testes para melhorar qualidade. Gestão de fontes mais eficientes. Empoderamento e maior liberdade para poder prospectar, analisar e desenhar o negócio. Investimento em treinamentos específicos. '),
