('248', '2018-09-21 12:30:52', '7', 'pt-BR', '1936922955', '2018-09-21 12:20:44', '2018-09-21 12:30:52', '172.16.5.83', NULL, 'A3', 'Y', 'A2', 'Y', '', 'Y', '', 'Y', '', '', '', 'Y', '', 'Y', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', 'Conhecimento Zabbix', '', '', '', '', '', '', '', '', '', '', 'Acredito que a falta de tempo/recurso prejudica a melhoria das atividades e processos.'),
('249', '2018-09-21 12:25:44', '7', 'pt-BR', '642817332', '2018-09-21 12:22:50', '2018-09-21 12:25:44', '172.16.5.83', NULL, 'A2', 'Y', 'A4', 'Y', 'Y', '', '', '', '', '', '', 'Y', 'Y', '', 'Y', '', 'Y', '', 'Y', '', '', '', '', 'Y', '', 'Y', '', '', '', '', '', 'Y', '', '', '', '', '', 'Y', '', '', '', 'Y', '', '', '', '', '', 'precisamos parar e mudar. \nseria um passo para traz para poder sair correndo depois. Ganhariamos em agilidade e velocidade\npenso ser estrategico'),
('250', '2018-09-21 12:29:36', '7', 'pt-BR', '1795081229', '2018-09-21 12:23:42', '2018-09-21 12:29:36', '172.16.5.84', NULL, 'A3', 'Y', 'A4', '', 'Y', 'Y', '', 'Y', '', 'Y', '', 'Y', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', ''),
('251', '2018-09-21 12:31:00', '7', 'pt-BR', '924067213', '2018-09-21 12:24:57', '2018-09-21 12:31:00', '172.16.5.84', NULL, 'A1', 'Y', 'A2', '', 'Y', 'Y', '', '', '', '', 'Y', '', 'Y', '', 'Y', '', '', 'Y', 'Y', '', '', '', '', 'Y', '', 'Y', '', '', '', '', '', 'Y', '', '', '', 'Y', '', '', '', '', '', '', '', 'Y', '', '', '', ''),
('252', '2018-09-21 12:50:52', '7', 'pt-BR', '856702355', '2018-09-21 12:29:21', '2018-09-21 12:50:52', '172.16.5.84', NULL, 'A1', 'Y', 'A2', '', '', '', '', '', 'Y', 'Y', '', '', 'Y', 'Y', '', 'Y', '', '', '', '', 'Mentalidade dos gestores e práticas do cliente.', 'Y', '', 'Y', '', '', '', 'Y', '', 'Y', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Não adianta querermos adotar as melhores práticas se o cliente quer dispensá-las em nome de custo e prazo. Podemos fazer uma analogia com o mercado onde temos dois produtos com o mesmo propósito, porém um foi feito com qualidade e custa mais caro, outro outro usou um processo de construção simples, materiais baratos, etc. O segundo produto custará muito mais barato e será entregue antes, mas com certeza o cliente terá muito mais problema em sua utilização. Se o nosso cliente usa um terno de 10.000 dólares, porque ainda opta por um sistema barato ao invés de um sistema de qualidade?\nE por outro lado a Scopus parece estar fazendo muita coisa \"pra Inglês ver\", pra mostrar pra acionista e tal, enquanto quem realmente põe a mão na massa não está sentindo muita diferença.'),
('253', '2018-09-21 12:35:48', '7', 'pt-BR', '1181253626', '2018-09-21 12:29:37', '2018-09-21 12:35:48', '172.16.5.84', NULL, 'A4', 'Y', 'A2', 'Y', 'Y', 'Y', '', '', 'Y', '', '', '', 'Y', '', '', '', 'Y', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', 'TFS, Jira', '', '', '', '', '', '', '', '', '', '', 'Y', 'TFS', '', '', ''),
('254', '2018-09-21 12:44:36', '7', 'pt-BR', '1172486384', '2018-09-21 12:30:46', '2018-09-21 12:44:36', '172.16.5.83', NULL, 'A1', 'N', 'A2', '', 'Y', '', '', '', 'Y', '', '', '', 'Y', '', 'Y', 'Y', 'Y', '', 'Y', '', 'Bloqueios de frameworks internos', 'Y', 'Maven', 'Y', 'TFS', 'Y', '', 'Y', 'Integração Continua da Bradesco Seguros', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'O principal problema que enfrentamos hoje é a qualidade dos requisitos que chegam à equipe de desenvolvimento.\nCom requisitos ruins e prazo definido baseado nesses requisitos o desenvolvimento é severamente prejudicado.'),
