('259', '2018-09-21 12:42:59', '7', 'pt-BR', '740335483', '2018-09-21 12:37:20', '2018-09-21 12:42:59', '172.16.5.83', NULL, 'A3', 'Y', 'A4', 'Y', '', 'Y', '', '', '', '', 'Y', 'Y', '', 'Y', '', '', '', 'Y', 'Y', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', ''),
