('300', '2018-09-24 21:52:53', '7', 'pt-BR', '1300520426', '2018-09-24 21:38:17', '2018-09-24 21:52:53', '172.16.216.61', NULL, 'A1', 'Y', 'A4', '', 'Y', '', '', '', '', 'Y', 'Y', '', 'Y', '', 'Y', '', 'Y', 'Y', 'Y', '', 'Falta de processos e tarefas bem definidos', '', '', 'Y', 'TFS', '', '', 'Y', 'TFS, IC (Bradesco Seguros)', '', '', 'Y', 'TFS, IBM RTC', '', '', 'Y', 'Nagios, Genius', '', '', '', '', '', '', '', '', '', '', '- Existência de um ambiente de testes com as mesmas configurações do ambiente de produção;\r\n- Desenvolvedor focado no desenvolvimento, deixando tarefas de implantação (criação da requisição de mudança e suas respectivas burocracias) para uma pessoa focada apenas nisso;\r\n- Monitoramento dos serviços que as aplicações utilizam, de modo que possamos saber quando elas estão indisponíveis antes de precisarmos delas, evitando ficar com testes parados (por exemplo, um monitoramento que nos avise quando determinada aplicação está inacessível, ou que abra um incidente automaticamente para que alguém possa classificar, investigar e/ou passar para a equipe responsável);\r\n- Papéis bem definidos e pessoas responsáveis pelo ambiente de desenvolvimento. Hoje quando abrimos incidentes no Service Manager, a maioria deles cai para Administração de Redes que nem sempre pode resolver questões relacionadas à configuração de ambiente, e ficamos sem saber quem pode nos ajudar. Internet Banking, por exemplo, parece um território sem dono;\r\n- Qualificação em qualidade do código, para assegurarmos que aquilo que está sendo desenvolvido (muitas vezes na pressa) não está prejudicando a performance dos ambientes de desenvolvimento, homologação e produção, bem como a segurança da informação.'),
('301', '2018-09-25 11:22:31', '7', 'pt-BR', '785760930', '2018-09-25 11:14:42', '2018-09-25 11:22:31', '172.16.58.134', NULL, 'A1', 'Y', 'A5', 'Y', 'Y', '', '', 'Y', '', '', 'Y', '', '', '', 'Y', '', 'Y', 'Y', 'Y', '', '', 'Y', 'Maven', 'Y', 'TFS, Git', 'Y', 'Checkstyle, PMD', 'Y', 'TFS', 'Y', 'JUnit', 'Y', 'TFS', '', '', '', '', 'Y', 'JMeter', '', '', '', '', 'Y', 'TFS, Starteam, HP', 'FMDA', '', 'Precisamos implementar de forma gradual e objetiva novos frameworks de implementação em conjunto com toda uma infra de DevOps. Nosso maior cliente, o Banco Bradesco, precisa ganhar agilidade na liberação de produtos com urgência.'),
('302', '2018-09-25 17:23:50', '7', 'pt-BR', '1193771326', '2018-09-25 17:03:49', '2018-09-25 17:23:50', '172.16.5.84', NULL, 'A1', 'Y', 'A1', 'Y', '', 'Y', '', '', 'Y', 'Y', 'Y', '', '', '', '', '', 'Y', '', 'Y', '', '', 'Y', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', 'Garantir a documentação desde a definição do projeto até os requisitos funcionais e não funcionais'),
