('369', '2018-10-10 19:44:03', '7', 'pt-BR', '1406573698', '2018-10-10 19:19:38', '2018-10-10 19:44:03', '10.16.30.26', NULL, 'A4', 'Y', 'A4', '', 'Y', 'Y', '', '', '', '', '', 'Y', '', 'Y', 'Y', '', 'Y', 'Y', 'Y', 'Y', 'Apoio da Gerência', '', '', 'Y', '', '', '', 'Y', '', '', '', 'Y', '', '', '', 'Y', '', '', '', '', '', 'Y', '', '', '', '', '', '- Primeiramente, um apoio maior da Gerência na adoção de uma filosofia/cultura (DevOps) que irá trazer muitos benefícios para a empresa e os seus clientes.\n- Todos os funcionários precisam vestir a camisa nessa mudança de cultura, aos poucos ir solidificando a filosofia DevOps. Zelar pela automação de processos.\n- Após a solidificação do DevOps, adotar também a filosofia/cultura DevSecOps, incorporando Segurança nesse processo de desenvolvimento ágil de software, entregando softwares seguros e de qualidade.\n- Seguir o que preza o PDCA, sempre zelar pelo processo de melhoria contínua.'),
