('378', '2018-10-11 11:49:27', '7', 'pt-BR', '973169558', '2018-10-11 11:39:19', '2018-10-11 11:49:27', '172.16.5.83', NULL, 'A1', 'Y', 'A5', 'Y', 'Y', '', '', 'Y', '', 'Y', 'Y', '', '', '', '', '', 'Y', 'Y', 'Y', 'Y', 'Projetos que presidentes e diretores pedem com prazos apertadissimos', '', '', 'Y', 'TFS, GITHUB', 'Y', 'SonarQube, Checkstyle, PMD', 'Y', 'TFS', '', '', 'Y', 'TFS, JIRA', '', '', '', '', '', '', '', '', '', '', 'Y', 'TFS, Startteam', '', '', ''),
('379', '2018-10-11 12:03:27', '7', 'pt-BR', '1003399990', '2018-10-11 11:59:11', '2018-10-11 12:03:27', '172.16.5.83', NULL, 'A1', 'Y', 'A2', 'Y', '', '', 'Y', '', '', '', 'Y', 'Y', '', '', '', 'Y', 'Y', '', 'Y', '', '', 'Y', '', 'Y', '', 'Y', '', 'Y', '', 'Y', '', 'Y', '', '', '', '', '', '', '', 'Y', '', '', '', 'Y', '', '', '', 'Desde o início do projeto é necessário tempo para preparação de ambiente integrado para desenvolvimento e entrega de software. Definição de padrões a serem adotados e melhorados pelos times.'),
('380', '2018-10-15 08:40:00', '7', 'pt-BR', '2073893756', '2018-10-15 08:25:40', '2018-10-15 08:40:00', '172.16.5.83', NULL, 'A1', 'Y', 'A4', 'Y', 'Y', '', '', '', 'Y', '', 'Y', 'Y', '', '', '', '', 'Y', '', 'Y', 'Y', '', 'Y', '', 'Y', '', 'Y', '', 'Y', '', 'Y', '', 'Y', '', '', '', '', '', '', '', 'Y', '', '', '', 'Y', '', '', '', 'Ter mais liberdade na escolha da tecnologia que irá desenvolver um projeto, como linguagens e ferramentas de desenvolvimento. Ter um ambiente de desenvolvimento independente, como usar docker com uma imagem do ambiente onde somente eu estarei trabalhando simulando um ambiente de desenvolvimento. ter uma ambiente de automação, com build/deploy continuos, ter uma equipe mais proxima para esclarecimento de eventuiais duvidas tecnicas e pessoas que consigam entender a regra de negocio a ponto de nos esplicar de forma clara e simples.'),
('381', '2018-10-15 09:20:23', '7', 'pt-BR', '1896928652', '2018-10-15 09:14:39', '2018-10-15 09:20:22', '172.16.5.83', NULL, 'A1', 'Y', 'A4', '', 'Y', '', '', '', 'Y', '', '', 'Y', '', '', 'Y', 'Y', 'Y', '', '', '', '', 'Y', '', 'Y', '', '', '', 'Y', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Acredito que estipular prazos mais incisivos e diretos, além de um maior controle para a Gestão de Configuração pois aceleraria o processo de desenvolvimento.'),
('382', '2018-10-15 09:29:42', '7', 'pt-BR', '1219981169', '2018-10-15 09:26:01', '2018-10-15 09:29:42', '172.16.5.84', NULL, 'A1', 'Y', 'A2', '', 'Y', 'Y', '', '', '', '', 'Y', '', '', '', 'Y', 'Y', 'Y', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', 'Y', '', '', '', 'Y', '', '', '', ''),
('383', '2018-10-15 16:47:59', '7', 'pt-BR', '557940214', '2018-10-15 16:23:57', '2018-10-15 16:47:59', '172.16.5.83', NULL, 'A2', 'Y', 'A4', '', '', '', '', '', 'Y', '', '', 'Y', '', '', 'Y', 'Y', 'Y', 'Y', '', '', '', 'Y', '', 'Y', '', 'Y', '', 'Y', '', 'Y', '', 'Y', '', '', '', '', '', 'Y', '', 'Y', '', '', '', 'Y', '', '', '', '1. não temos pequenos eventos constantes de passagem de conhecimento, só grandes eventos \n2. precisamos repensar o lançamento de horas para iniciativas internas, estimular o aprendizado e contato com o novo\n3. precisamos utilizar na empresa uma ferramenta de ambiente virtual como slack, não só o comunicador instantâneo Skype\n\n'),
