('15', '2018-12-04 08:22:08', '1', 'pt-BR', '1849099563', '2018-12-04 08:21:09', '2018-12-04 08:22:08', '172.16.65.52', 'A3', 'A3', 'A3', '', 'O Leon é um ótimo palestrante !!'),
('16', '2018-12-04 08:21:48', '1', 'pt-BR', '680686451', '2018-12-04 08:21:26', '2018-12-04 08:21:48', '172.16.14.55', 'A3', 'A3', 'A3', '', ''),
('17', '2018-12-04 08:23:27', '1', 'pt-BR', '740268651', '2018-12-04 08:22:58', '2018-12-04 08:23:27', '172.16.5.83', 'A3', 'A2', 'A3', '', ''),
('18', '2018-12-04 08:25:52', '1', 'pt-BR', '1904245615', '2018-12-04 08:24:02', '2018-12-04 08:25:52', '172.16.57.65', 'A3', 'A3', 'A3', '', 'Uma sugestão é para todos os treinamentos na Scopus sejam gravados e disponibilizados para aqueles que não puderam assistir, Que este tipo de palestra seja cada vez mais frequente e que tragam também pessoas de mercado para fazerem mais palestras.'),
('19', '2018-12-04 08:29:41', '1', 'pt-BR', '524308405', '2018-12-04 08:26:01', '2018-12-04 08:29:41', '10.16.30.27', 'A3', 'A3', 'A3', '', 'Foi excelente, ainda mais com linguagem para que o tema complexo fosse possível ser absorvido por todos e dentro de um tempo otimizado.'),
('20', '2018-12-04 08:39:41', '1', 'pt-BR', '1080487508', '2018-12-04 08:32:29', '2018-12-04 08:39:41', '172.16.5.84', 'A3', 'A3', 'A3', '', 'Precisamos de muito menos treinamentos comportamentais, e muito mais eventos técnico-acadêmicos desse tipo. Afinal, somos uma empresa de tecnologia, e é o conhecimento científico que agrega valor ao que fazemos.'),
