('141468', 'pt-BR', 'DevOps', '<h3>O objetivo deste questionário é para termos uma ideia do conhecimento dos colaboradores em relação ao tema DevOps.</h3>\r\n', '<h1>Seja bem vindo!</h1>\r\n', 'Agradecemos sua participação!', '', '', '', 'http://intranet/NovoSite/default.asp', 'Intranet da Scopus Soluções em TI.', 'Convite para participar de um questionário', 'Caro(a)  {FIRSTNAME},<br />\nVocê foi convidado(a) a participar de uma pesquisa.<br />\nTítulo da Pesquisa: \"{SURVEYNAME}\"<br />\nDescrição da Pesquisa: \"{SURVEYDESCRIPTION}\"<br />\n<br />\nPara responder ao questionário, clique no link abaixo:<br />\n{SURVEYURL}<br />\n<br />\n---------------------------------------------<br />\nAtenciosamente,<br />\n<br />\n{ADMINNAME} ({ADMINEMAIL})<br />\n<br />\nSe você não deseja participar desta pesquisa e não deseja receber mais convites, por favor clique no seguinte link:<br />\n{OPTOUTURL}<br />\n<br />\nSe você está bloqueado mas deseja participar desta pesquisa e quer receber convites, por favor, clique no seguinte link:<br />\n{OPTINURL}', 'Lembrete para participar da pesquisa', 'Caro(a) {FIRSTNAME}<br />\n<br />\nRecentemente, nós lhe convidamos para participar de uma pesquisa. Notamos que ela ainda não foi finalizada e desejamos lembrar-lhe que o questionário ainda está disponível caso deseje completá-lo.<br />\n<br />\nO título da pesquisa é:<br />\n\"{SURVEYNAME}\"<br />\n<br />\n\"{SURVEYDESCRIPTION}\"<br />\n<br />\nPara participar, por favor utilize o link abaixo.<br />\n<br />\nAtenciosamente,<br />\n<br />\n{ADMINNAME} ({ADMINEMAIL})<br />\n<br />\n----------------------------------------------<br />\nClique no link para responder o questionário:<br />\n{SURVEYURL}<br />\n<br />\nSe você não deseja participar desta pesquisa e não deseja receber mais convites, por favor clique no seguinte link:<br />\n{OPTOUTURL}', 'Confirmação de inscrição na pesquisa', 'Caro(a) {FIRSTNAME},<br />\n<br />\nVocê ou alguém usando o seu e-mail inscreveu-se para participar da pesquisa on-line de nome {SURVEYNAME}.<br />\nPara responder o questionário, por favor, clique no link abaixo:<br />\n<br />\n{SURVEYURL}<br />\n<br />\nCaso haja alguma dúvida ou não tenha sido você a fazer a inscrição, por favor, entre em contato com {ADMINNAME}, através do e-mail {ADMINEMAIL}.', 'Confirmação da sua particição no questionário', 'Caro {FIRSTNAME},<br />\n <br />\neste e-mail é para confirmar que você concluiu a pesquisa intitulada {SURVEYNAME} e sua resposta foi salva. Obrigado por participar. <br />\n <br />\nSe você tem alguma dúvida sobre este e-mail, por favor, entre em contato com {ADMINNAME} em {ADMINEMAIL}.<br />\n <br />\n Atenciosamente,<br />\n <br />\n {ADMINNAME}', '1', NULL, 'Envio de resposta para o questionário {SURVEYNAME}', 'Hello,<br />\n<br />\nA new response was submitted for your survey \'{SURVEYNAME}\'.<br />\n<br />\nClick the following link to see the individual response:<br />\n{VIEWRESPONSEURL}<br />\n<br />\nClick the following link to edit the individual response:<br />\n{EDITRESPONSEURL}<br />\n<br />\nView statistics by clicking here:<br />\n{STATISTICSURL}', 'Envio de resposta para pesquisa {SURVEYNAME} com resultados', 'Hello,<br />\n<br />\nA new response was submitted for your survey \'{SURVEYNAME}\'.<br />\n<br />\nClick the following link to see the individual response:<br />\n{VIEWRESPONSEURL}<br />\n<br />\nClick the following link to edit the individual response:<br />\n{EDITRESPONSEURL}<br />\n<br />\nView statistics by clicking here:<br />\n{STATISTICSURL}<br />\n<br />\n<br />\nThe following answers were given by the participant:<br />\n{ANSWERTABLE}', '0', NULL),
('792981', 'pt-BR', 'DevOps - Pesquisa de Situação', '<p><span style=\"font-size:14px;\">Nosso objetivo com este pequeno questionário é avaliar o quanto estamos a par da definição de DevOps e quais conhecimentos possuímos que possam nos auxiliar nessa jornada. Isso nos ajudará nos próximos passos.</span></p>\r\n\r\n<p><span style=\"font-size:14px;\">Decidimos por criar um novo formato de pesquisa. Esta plataforma de pesquisas está hospedada na Scopus e atende melhor às nossas necessidades. Com isso, podemos manter uma base histórica unificada de todas as pesquisas que realizarmos.</span></p>\r\n', '<p style=\"text-align:center;\"><span style=\"font-size:14px;\"><strong>Seja bem-vindo(a) à pesquisa de situação de DevOps na Scopus</strong></span></p>\r\n\r\n<p><span style=\"font-size:14px;\">Desde já agradecemos a sua participação em nossa pesquisa. Você será apresentado a algumas questões, e suas respostas nos ajudarão a melhorar nosso ambiente de trabalho.</span></p>\r\n\r\n<p> </p>\r\n\r\n<p style=\"text-align:center;\"><span style=\"font-size:14px;\"><strong>Contamos com sua participação!</strong></span></p>\r\n', 'Muito obrigado por participar de nossa pesquisa. Em breve, os resultados serão publicados e você será informado.', '', '', '', 'http://extranet.scopus.com.br/NovoSite/default.asp', 'Intranet Scopus', 'DevOps - Convite para participar de um questionário', '<p><a href=\"@@SURVEYURL@@\"><img alt=\"Clique com o botão direito do mouse ou toque e segure para baixar a imagem.\" src=\"http://survey.scopus.com.br/upload/surveys/792981/images/devops.jpg\" style=\"width:600px;\" /></a></p>\r\n\r\n<p style=\"margin-right:0cm;margin-left:0cm;\"><span style=\"font-size:14px;\"><span style=\"font-family:\'Lucida Sans Unicode\', \'Lucida Grande\', sans-serif;\">Caso o link da imagem não funcione, copie e cole o link abaixo no seu navegador.</span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:\'Lucida Sans Unicode\', \'Lucida Grande\', 