/>\r\n{SURVEYURL}<br />\r\n<br />\r\nCaso haja alguma dúvida ou não tenha sido você a fazer a inscrição, por favor, entre em contato com {ADMINNAME}, através do e-mail {ADMINEMAIL}.</span>', 'Confirmação da sua particição no questionário', '<p><span style=\"font-family:Arial, Helvetica, sans-serif;\">Caro {FIRSTNAME},<br />\r\n<br />\r\nEste e-mail é para confirmar que você concluiu a pesquisa intitulada {SURVEYNAME} e sua resposta foi salva. Obrigado por participar.<br />\r\n<br />\r\nSe você tem alguma dúvida sobre este e-mail, por favor, entre em contato com {ADMINNAME} em {ADMINEMAIL}.</span><br />\r\n </p>\r\n\r\n<p><br />\r\n<span style=\"font-family:Arial, Helvetica, sans-serif;\">Atenciosamente,</span></p>\r\n\r\n<p><span style=\"font-family:Arial, Helvetica, sans-serif;\">{ADMINNAME} ({ADMINEMAIL})</span></p>\r\n', '5', NULL, 'Envio de resposta para o questionário {SURVEYNAME}', '<p><span style=\"font-family:Arial, Helvetica, sans-serif;\"><span style=\"font-size:16px;\">Olá,<br />\r\n<br />\r\nUma nova resposta ao seu questionário \'{SURVEYNAME}\' foi enviada.</span></span></p>\r\n\r\n<p><span style=\"font-family:Arial, Helvetica, sans-serif;\"><span style=\"font-size:16px;\">Clique no link a seguir para ver a resposta individual:<br />\r\n{VIEWRESPONSEURL}<br />\r\n<br />\r\nClique no link a seguir para editar a resposta individual:<br />\r\n{EDITRESPONSEURL}</span><br />\r\n<br />\r\nVeja as estatíticas clicando aqui:</span><br />\r\n<span style=\"font-family:Arial, Helvetica, sans-serif;\"><span style=\"font-size:16px;\">{STATISTICSURL}</span></span></p>\r\n', 'Envio de resposta para pesquisa {SURVEYNAME} com resultados', '<span style=\"font-family:Arial, Helvetica, sans-serif;\">Olá,<br />\r\n<br />\r\nUma nova resposta ao seu questionário \'{SURVEYNAME}\'.<br />\r\n<br />\r\nClique no link a seguir para ver a resposta individual:<br />\r\n{VIEWRESPONSEURL}<br />\r\n<br />\r\nClique no link a seguir para editar a resposta individual:<br />\r\n{EDITRESP