('541675', 'pt-BR', 'Teste de Convite', 'Questionário para teste de envio de e-mail com convites.', 'Seja bem-vindo ao questionário de teste do sistema de pesquisas LimeSurvey. O intuito desta ferramenta é facilitar a pesquisa de opinião dentro da Scopus, melhorando as atuações dos departamentos e melhorando o entendimento das necessidades de cada área. Para isso, sua colaboração será essencial.', 'Obrigado por participar deste teste. Sua colaboração foi de extrema importância.', '', '', '', '', '', 'Convite para participar de um questionário', 'Caro(a)  {FIRSTNAME},<br />\nVocê foi convidado(a) a participar de uma pesquisa.<br />\nTítulo da Pesquisa: \"{SURVEYNAME}\"<br />\nDescrição da Pesquisa: \"{SURVEYDESCRIPTION}\"<br />\n<br />\nPara responder ao questionário, clique no link abaixo:<br />\n{SURVEYURL}<br />\n<br />\n---------------------------------------------<br />\nAtenciosamente,<br />\n<br />\n{ADMINNAME} ({ADMINEMAIL})<br />\n<br />\nSe você não deseja participar desta pesquisa e não deseja receber mais convites, por favor clique no seguinte link:<br />\n{OPTOUTURL}<br />\n<br />\nSe você está bloqueado mas deseja participar desta pesquisa e quer receber convites, por favor, clique no seguinte link:<br />\n{OPTINURL}', 'Lembrete para participar da pesquisa', 'Caro(a) {FIRSTNAME}<br />\n<br />\nRecentemente, nós lhe convidamos para participar de uma pesquisa. Notamos que ela ainda não foi finalizada e desejamos lembrar-lhe que o questionário ainda está disponível caso deseje completá-lo.<br />\n<br />\nO título da pesquisa é:<br />\n\"{SURVEYNAME}\"<br />\n<br />\n\"{SURVEYDESCRIPTION}\"<br />\n<br />\nPara participar, por favor utilize o link abaixo.<br />\n<br />\nAtenciosamente,<br />\n<br />\n{ADMINNAME} ({ADMINEMAIL})<br />\n<br />\n----------------------------------------------<br />\nClique no link para responder o questionário:<br />\n{SURVEYURL}<br />\n<br />\nSe você não deseja participar desta pesquisa e não deseja receber mais convites, por favor clique no seguinte link:<br />\n{OPTOUTURL}', 'Confirmação de inscrição na pesquisa', 'Caro(a) {FIRSTNAME},<br />\n<br />\nVocê ou alguém usando o seu e-mail inscreveu-se para participar da pesquisa on-line de nome {SURVEYNAME}.<br />\nPara responder o questionário, por favor, clique no link abaixo:<br />\n<br />\n{SURVEYURL}<br />\n<br />\nCaso haja alguma dúvida ou não tenha sido você a fazer a inscrição, por favor, entre em contato com {ADMINNAME}, através do e-mail {ADMINEMAIL}.', 'Confirmação da sua particição no questionário', 'Caro {FIRSTNAME},<br />\n <br />\neste e-mail é para confirmar que você concluiu a pesquisa intitulada {SURVEYNAME} e sua resposta foi salva. Obrigado por participar. <br />\n <br />\nSe você tem alguma dúvida sobre este e-mail, por favor, entre em contato com {ADMINNAME} em {ADMINEMAIL}.<br />\n <br />\n Atenciosamente,<br />\n <br />\n {ADMINNAME}', '1', NULL, 'Envio de resposta para o questionário {SURVEYNAME}', 'Hello,<br />\n<br />\nA new response was submitted for your survey \'{SURVEYNAME}\'.<br />\n<br />\nClick the following link to see the individual response:<br />\n{VIEWRESPONSEURL}<br />\n<br />\nClick the following link to edit the individual response:<br />\n{EDITRESPONSEURL}<br />\n<br />\nView statistics by clicking here:<br />\n{STATISTICSURL}', 'Envio de resposta para pesquisa {SURVEYNAME} com resultados', 'Hello,<br />\n<br />\nA new response was submitted for your survey \'{SURVEYNAME}\'.<br />\n<br />\nClick the following link to see the individual response:<br />\n{VIEWRESPONSEURL}<br />\n<br />\nClick the following link to edit the individual response:<br />\n{EDITRESPONSEURL}<br />\n<br />\nView statistics by clicking here:<br />\n{STATISTICSURL}<br />\n<br />\n<br />\nThe following answers were given by the participant:<br />\n{ANSWERTABLE}', '1', NULL),
('691921', 'pt-BR', 'Avaliação de Reação - Curso XPTO', '<p style=\"margin-left:-14.2pt;margin:0cm 0cm .0001pt;\"><span style=\"font-size:10pt;\"><span><b><i><span style=\"font-size:11pt;\"><span>Caro participante,</span></span></i></b></span></span></p>\r\n\r\n<p style=\"margin-left:-14.2pt;margin:0cm 0cm .0001pt;\"> </p>\r\n\r\n<p><span style=\"font-size:11pt;\"><span>Sua opinião é muito importante para que possamos atingir um nível de qualidade cada vez maior em nossos cursos. Portanto, solicitamos que responda a este questionário.</span></span></p>\r\n', '<strong>Seja bem vindo!</strong>', '<p><strong>Muito obrigado pela sua participação.</strong></p>\r\n\r\n<p> </p>\r\n', '', '', '', 'http://extranet.scopus.com.br/NovoSite/default.asp', 'Intranet da Scopus Soluções em TI.', 'Convite para participar de um questionário', '<p>Caro(a) {FIRSTNAME},<br />\r\nVocê foi convidado(a) a participar de uma pesquisa.<br />\r\nTítulo da Pesquisa: {SURVEYNAME}<br />\r\nDescrição da Pesquisa: {SURVEYDESCRIPTION}<br />\r\n<br />\r\nPara responder ao questionário, clique no link abaixo:<br />\r\n{SURVEYURL}<br />\r\n </p>\r\n\r\n<p>Atenciosamente,<br />\r\n<br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:130%\"><span style=\"text-autospace:none\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"line-height:130%\"><span style=\"font-family:&quot;Verdana&quot;,sans-serif\"><span style=\"color:#00438c\">{ADMINNAME}</span></span></span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"text-autospace:none\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Verdana&quot;,sans-serif\"><span style=\"color:#666666\">Scopus Soluções em TI</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"text-autospace:none\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.