r />\nCaso haja alguma dúvida ou não tenha sido você a fazer a inscrição, por favor, entre em contato com {ADMINNAME}, através do e-mail {ADMINEMAIL}.', 'Confirmação da sua particição no questionário', 'Caro {FIRSTNAME},<br /><br />\neste e-mail é para confirmar que você concluiu a pesquisa intitulada {SURVEYNAME} e sua resposta foi salva. Obrigado por participar. <br /><br />\nSe você tem alguma dúvida sobre este e-mail, por favor, entre em contato com {ADMINNAME} em {ADMINEMAIL}.<br /><br />\n Atenciosamente,<br /><br />\n {ADMINNAME}', '1', NULL, 'Envio de resposta para o questionário {SURVEYNAME}', 'Hello,<br /><br />\nA new response was submitted for your survey \'{SURVEYNAME}\'.<br /><br />\nClick the following link to see the individual response:<br />\n{VIEWRESPONSEURL}<br /><br />\nClick the following link to edit the individual response:<br />\n{EDITRESPONSEURL}<br /><br />\nView statistics by clicking here:<br />\n{STATISTICSURL}', 'Envio de resposta para pesquisa {SURVEYNAME} com resultados', 'Hello,<br /><br />\nA new response was submitted for your survey \'{SURVEYNAME}\'.<br /><br />\nClick the following link to see the individual response:<br />\n{VIEWRESPONSEURL}<br /><br />\nClick the following link to edit the individual response:<br />\n{EDITRESPONSEURL}<br /><br />\nView statistics by clicking here:<br />\n{STATISTICSURL}<br /><br /><br />\nThe following answers were given by the participant:<br />\n{ANSWERTABLE}', '0', NULL);
